import { Parallax } from "react-parallax";

const Hero = (bgimage) => (
  <Parallax
    blur={2}
    bgImage={bgimage}
    bgImageAlt="RPGS dices on a table"
    strength={800}
    className="hero"
  >
    <h1>
      <span className="text-red-color">Level Up </span>Your RPGs experience
      <br />
      <p>
        with Note Maker's
        <span className="text-red-color"> Intuitive Tools!</span>
      </p>
    </h1>
  </Parallax>
);

export default Hero;
{
  /* find your notes in just a few clicks: Keep your campaign details organized and easily accessible.
The ideal companion for all role-players: Whether you're a seasoned Game Master or a new player, Note Maker helps you stay on top of your game. */
}
